CREATE TABLE m_story_member_rewards(
  story_member_master_id INTEGER NOT NULL,
  display_order INTEGER NOT NULL,
  content_type INTEGER NOT NULL,
  content_id INTEGER NOT NULL,
  content_amount INTEGER NOT NULL,
  PRIMARY KEY (story_member_master_id, content_type, content_id),
  FOREIGN KEY (story_member_master_id) REFERENCES m_story_member(id)
);
